// client/src/components/Notebook.jsx
import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

const Notebook = ({ steps }) => {
  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h5" gutterBottom>ðŸ““ Notebook Output</Typography>
      {steps.map((step, idx) => (
        <Paper key={idx} sx={{ p: 2, mb: 3, backgroundColor: '#f8f9fa' }}>
          <Typography variant="subtitle1"><strong>Prompt:</strong> {step.prompt}</Typography>
          <Typography variant="subtitle2" sx={{ mt: 1, fontWeight: 'bold' }}>Generated Code:</Typography>
          <pre style={{ backgroundColor: '#eee', padding: '10px', overflowX: 'auto' }}>
            {step.code}
          </pre>
          {step.output && (
            <>
              <Typography variant="subtitle2" sx={{ mt: 1, fontWeight: 'bold' }}>Output:</Typography>
              {step.output.type === 'image' ? (
                <img src={step.output.content} alt="output" style={{ maxWidth: '100%' }} />
              ) : (
                <pre style={{ backgroundColor: '#f1f1f1', padding: '10px', overflowX: 'auto' }}>
                  {step.output.content}
                </pre>
              )}
            </>
          )}
        </Paper>
      ))}
    </Box>
  );
};

export default Notebook;
